import React from 'react';
import './SideUser.scss';

const SIDE_DATA = [
  {
    src: '/taeyoung/images/userImg2.jpg',
    name: 'loren gray',
    key: '1',
  },
  {
    src: '/taeyoung/images/userImg1.jpg',
    name: 'akvosna',
    key: '2',
  },
  {
    src: '/taeyoung/images/userImg5.jpg',
    name: 'opbkaks',
    key: '3',
  },
  {
    src: '/taeyoung/images/userImg4.jpg',
    name: '229skvo',
    key: '4',
  },
  {
    src: '/taeyoung/images/userImg3.jpg',
    name: 'iiiwas23',
    key: '5',
  },
];

function SideUser() {
  return (
    <>
      {SIDE_DATA.map(sideData => {
        return (
          <div className="recommendPeople" key={sideData.key}>
            <div className="recommendPeopleMeta">
              <div className="recommendPeopleImg">
                <img src={sideData.src} alt="img" />
              </div>

              <span className="otherUser">
                <p className="PeopleName">{sideData.name}</p>
                <p className="PeopleFllow">{sideData.name}님이 팔로우합니다.</p>
              </span>
            </div>

            <button className="fllowBt2">팔로우</button>
          </div>
        );
      })}
    </>
  );
}

export default SideUser;
